        function renderCards(filterSelectedOnly = false) {
            container.innerHTML = "";
            const keyword = document.getElementById("searchInput").value.toLowerCase();
            const score = parseFloat(document.getElementById("scoreSlider").value);
            document.getElementById("scoreValue").innerText = score.toFixed(1);

            rawData.forEach((row, idx) => {
                const matchesType = !selectedType || row['Ï†ÑÌòïÏú†Ìòï'] === selectedType;
                const matchesKeyword = row['ÎåÄÌïôÎ™Ö']?.toLowerCase().includes(keyword) || row['Î™®ÏßëÎã®ÏúÑ']?.toLowerCase().includes(keyword);
                const cut = parseFloat(row['2025_70Ïª∑']);
                const matchesScore = isNaN(cut) || (cut >= score - 0.3 && cut <= score + 0.3);
                const isSelected = selectedCards.includes(idx);

                if ((matchesType && matchesKeyword && matchesScore && !filterSelectedOnly) || (filterSelectedOnly && isSelected)) {
                    const card = document.createElement("div");
                    card.className = "card";
                    card.innerHTML = `
                        <h2>${row['ÎåÄÌïôÎ™Ö']}</h2>
                        <p><strong>Ï†ÑÌòïÏú†Ìòï:</strong> ${row['Ï†ÑÌòïÏú†Ìòï']}</p>

                        <p><strong>2025 Í≤ΩÏüÅÎ•†:</strong> ${row['2025_Í≤ΩÏüÅÎ•†'] || '-'}</p>
                        <p><strong>2025 70%Ïª∑Îì±Í∏â:</strong> ${row['2025_70Ïª∑'] || '-'}</p>
                        <p><strong>2024 Í≤ΩÏüÅÎ•†:</strong> ${row['2024_Í≤ΩÏüÅÎ•†'] || '-'}</p>
                        <p><strong>2024 70%Ïª∑Îì±Í∏â:</strong> ${row['2024_70Ïª∑'] || '-'}</p>
                        <input type="checkbox" onchange="toggleSelect(${idx})" ${isSelected ? 'checked' : ''}> ÏÑ†ÌÉù
                    `;
                    container.appendChild(card);
                }
            });
        }

        function toggleSelect(idx) {
            if (selectedCards.includes(idx)) {
                selectedCards = selectedCards.filter(i => i !== idx);
            } else {
                selectedCards.push(idx);
            }
            localStorage.setItem("selectedCards", JSON.stringify(selectedCards));

        const types = [...new Set(rawData.map(row => row['Ï†ÑÌòïÏú†Ìòï']).filter(Boolean))];
        const filterContainer = document.getElementById("typeFilters");
        types.forEach(type => {

            btn.className = "filter-button";
            btn.innerText = type;
